import IndexGenres from "../Genres/IndexGenres";
import HomePage from "../Movies/HomePage";

//centralized route config
const routes = [
    {
        path: "/",
        exact: true,
        component: HomePage,
    },
    {
        path: "/genres",
        exact: true,
        component: IndexGenres,
    },
];

export default routes;
